import React from "react";
import ReactDom from "react-dom";
import Card from './Card';
import Sdata from './Sdata';


import './App';


ReactDom.render(
    <>
    <h1 className="heading_style">Top 5 netflix series</h1>
    {Sdata.map((val)=>{
        return(
            <Card
            imgsrc={val.imgsrc}
            title={val.title}
            sname={val.sname}
            link={val.link} 

            />
        );
    })}
    </>
    , document.getElementById('root'));
